Mongoose validation error: first: Path `first` is required., last: Path `last` is required."<p>So there is another post on this, but it didn't seem to help at all.  I am making a MongoDB website to store names, using mongoose.  Here is my route and model code:</p>

<pre><code>const router = require("express").Router();
const Name = require("../models/name.model");
const moment = require("moment");

router.route("/").get((req, res) =&gt; {
  Name.find()
    .then((names) =&gt; res.json(names))
    .catch((err) =&gt; res.status(400).json("Error: " + err));
});
router.route("/add").post((req, res) =&gt; {
  const newName = new Name({
    first: req.body.firstName,
    last: req.body.lastName,
    date: moment().format("yyyy-mm-dd:hh:mm:ss"),
  });
  newName
    .save()
    .then(() =&gt; res.json("Name added to the list!"))
    .catch((err) =&gt; res.status(400).json("Error: " + err));
});

router.route("/:id").get((req, res) =&gt; {
  Name.findByIdAndDelete(req.params.id)
    .then(() =&gt; res.json("Name was deleted from the list!"))
    .catch((err) =&gt; res.status(400).json("Error: " + err));
});

module.exports = router;
</code></pre>

<pre><code>const mongoose = require("mongoose");
